const puppeteer = require('puppeteer');
const fs = require('fs');
const path = require('path');

const PLAYER_JS_PATH = path.join(__dirname, 'source_final.js');

// =======================================================
// [配置] 抓包数据
// =======================================================
const TARGET_ANC = ""; 
const CTX_DATA = {
    tm: "1765955162",          
    guid: "3c4e1a2d05e04405",  
    platform: "10201",         
    sdtfrom: "v1010",          
    appVer: "1.57.5",
    flowid: "962f58987c911fbdf3d7c268cae5feb0" 
};
// =======================================================

(async () => {
    let browser;
    try {
        console.log("[-] 正在读取源码文件...");
        let sourceCode = fs.readFileSync(PLAYER_JS_PATH, 'utf-8');

        // 1. 提取 VM 定义
        const cyDefRegex = /(var\s+(cy+)\s*=\s*function\s*\(\)\s*\{\s*function\s+[a-zA-Z]\([^\)]*\)\s*\{[\s\S]+?\}\(\);)/;
        const cyMatch = sourceCode.match(cyDefRegex);
        if (!cyMatch) throw new Error("无法定位 VM 定义");
        const vmVarName = cyMatch[2]; 

        // 2. 提取字节码
        const bytecodeRegex = new RegExp(`${vmVarName}\\s*\\(\\s*(['"])([^'"]+)\\1\\s*,\\s*false\\s*\\)`);
        const bytecodeMatch = sourceCode.match(bytecodeRegex);
        if (!bytecodeMatch) throw new Error("无法提取字节码");
        const RAW_BYTECODE = bytecodeMatch[2];

        // 3. 提取 Offset
        const offsetRegex = /\)\s*\(\s*(\d+)\s*,/;
        const offsetMatch = sourceCode.match(offsetRegex);
        const ENTRY_OFFSET = offsetMatch ? parseInt(offsetMatch[1]) : 6327;

        console.log(`[-] 提取成功: VM=${vmVarName}, Offset=${ENTRY_OFFSET}`);

        // 构造 helper
        const helperCode = `
            function gy(e) { return (e && typeof Symbol != "undefined" && e.constructor === Symbol) ? "symbol" : typeof e; }
            function ly(e, t) { return (t != null && typeof Symbol != "undefined" && t[Symbol.hasInstance]) ? !!t[Symbol.hasInstance](e) : e instanceof t; }
        `;
        const vmCode = cyMatch[1].replace(`var ${vmVarName}`, `window.${vmVarName}`);

        console.log("[-] 启动浏览器...");
        browser = await puppeteer.launch({
            headless: "new",
            args: ['--no-sandbox', '--disable-setuid-sandbox']
        });
        
        const page = await browser.newPage();
        
        // 开启 Console
        page.on('console', msg => {
            const text = msg.text();
            if (text.includes('[VM')) console.log(text);
        });

        await page.goto('https://v.qq.com/x/cover/mzc00200123456/t00123456.html', { waitUntil: 'domcontentloaded' });

        console.log("[-] 注入代码并执行...");

        const result = await page.evaluate(async (helpers, vmSource, varName, bytecode, offset, inputAnc, ctxData) => {
            return new Promise(async (resolve, reject) => {
                try {
                    // --- 1. 注入 ---
                    window.eval(helpers);
                    window.eval(vmSource);
                    
                    const vmFactory = window[varName];
                    if (typeof vmFactory !== 'function') throw new Error("VM 注入失败");

                    // --- 2. 构造“防爆”工厂 ---
                    // 只要遇到 undefined/null，就返回一个长度足够的 SafeString 对象
                    // 确保 [4] 这种索引访问绝对不报错
                    const makeSafe = (val, path) => {
                        if (val !== undefined && val !== null) return val;
                        // console.log(`[SafeProxy] Auto-mocking missing value: ${path}`);
                        // 返回一个5个空格的字符串对象，确保 [4] 不报错
                        return new String("     "); 
                    };

                    // --- 3. 环境代理 (Global Env) ---
                    const mockQimei = {
                        tools: {
                            getStorageItem: () => "",
                            setStorageItem: () => {},
                            getSessionItem: () => "",
                            setSessionItem: () => {},
                            getTimestamp: () => Math.floor(Date.now() / 1000) + "",
                            getFeature: () => ({}),
                            getCookieQ36: () => "",
                            getCookieUUID: () => "",
                            padStart: (str, len, pad) => String(str).padStart(len, pad),
                            autoTry: (fn) => { try { return fn(); } catch(e) { return undefined; } }
                        }
                    };

                    const envProxy = new Proxy(window, {
                        get: (target, prop) => {
                            if (prop === 'moduleQimei') return mockQimei;
                            
                            // 原生构造函数必须原样返回，否则 TypeError
                            if (['Object', 'Array', 'String', 'Number', 'Boolean', 'Date', 'Math', 'JSON', 'Promise', 'RegExp', 'Error', 'Uint8Array', 'Uint32Array', 'Int8Array', 'console'].includes(prop)) {
                                return window[prop];
                            }

                            // 其他属性，如果存在则返回，不存在则返回 SafeString
                            let val = undefined;
                            if (prop in window) {
                                val = window[prop];
                                if (typeof val === 'function' && !val.prototype) val = val.bind(window);
                            }
                            
                            return makeSafe(val, `Global.${String(prop)}`);
                        }
                    });

                    // --- 4. 上下文代理 (this) ---
                    // 构造一个包含所有数据的扁平对象
                    const baseContext = {
                        ...ctxData,
                        config: { ...ctxData, businessConfig: ctxData },
                        businessConfig: ctxData,
                        playerInstanceId: "puppeteer_inst",
                        logger: { log: ()=>{}, error: ()=>{} },
                        getCommonKv: (key) => {
                            if (!key) return "";
                            for (let k in ctxData) {
                                if (key.indexOf(k) > -1) return ctxData[k];
                            }
                            return "";
                        }
                    };

                    // 递归代理：无论访问多少层深，最终拿到 undefined 时都会变成 SafeString
                    const createRecursiveProxy = (target, path) => {
                        return new Proxy(target, {
                            get: (obj, prop) => {
                                let val = obj[prop];
                                
                                // 处理特殊属性
                                if (prop === 'then') return undefined; // Promise 兼容
                                if (prop === 'toString') return () => "[object Object]";

                                // 如果是对象，继续递归代理
                                if (val && typeof val === 'object') {
                                    return createRecursiveProxy(val, `${path}.${String(prop)}`);
                                }

                                // 如果是基本类型或函数，直接返回
                                if (val !== undefined && val !== null) {
                                    return val;
                                }

                                // 缺失值 -> 返回 SafeString
                                return makeSafe(val, `${path}.${String(prop)}`);
                            }
                        });
                    };

                    const safeCtx = createRecursiveProxy(baseContext, "ctx");

                    // --- 5. 初始化 VM ---
                    const responseModifier = vmFactory(bytecode, false)(offset, [], envProxy);

                    // --- 6. 执行 ---
                    const mockResData = {
                        "errCode": 0,
                        "vinfo": JSON.stringify({
                            "vl": {"vi": [{"fn": "dummy", "fvkey": "dummy"}]}, 
                            "tm": ctxData.tm,
                            "guid": ctxData.guid,
                            "anc": inputAnc
                        })
                    };

                    console.log("[VM] Start execution...");
                    const resultPromise = responseModifier.call(safeCtx, mockResData);
                    const result = await Promise.resolve(resultPromise);
                    
                    resolve(result || mockResData);

                } catch (e) {
                    reject(e.toString() + "\nStack: " + e.stack);
                }
            });
        }, helperCode, vmCode, vmVarName, RAW_BYTECODE, ENTRY_OFFSET, TARGET_ANC, CTX_DATA);

        console.log("\n[+] 最终结果:");
        console.log("---------------------------------------------------");
        
        let vinfo = result.vinfo;
        if (typeof vinfo === 'string') {
            try { vinfo = JSON.parse(vinfo); } catch(e){}
        }

        if (vinfo && vinfo.anc) {
            console.log("ANC Raw:", vinfo.anc);
            if (typeof vinfo.anc === 'object') {
                console.log("✅ [成功] anc 已解密为对象:", JSON.stringify(vinfo.anc, null, 2));
            } else if (vinfo.anc !== TARGET_ANC) {
                console.log("✅ [成功] anc 字符串已变化 (解密成功)");
            } else {
                console.log("⚠️ [结论] anc 未变化 (透传 Token)");
            }
        } else {
            console.log("Result:", result);
        }
        console.log("---------------------------------------------------");

    } catch (e) {
        console.error("[-] 执行出错:", e);
    } finally {
        if (browser) await browser.close();
    }
})();